import './TopNav.css';

function TopNav({menu}) {
    const edu = menu[0];
    const recruit = menu[1];
    const participate = menu[2];
    return (
    <nav className="menu">
        <div className="menu-left">
            <button>Button 1</button>
            <button>Button 2</button>
        </div>
        <div className="menu-right">
            <button>Button 3</button>
        </div>
    </nav>

    );
};

export default TopNav;
